"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Vaccines and pregnancy (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/vaccines-and-pregnancy-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H1643010845\">",
"      <span class=\"h1\">",
"       What are vaccines?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Vaccines are treatments that can prevent certain serious or deadly infections. They work by preparing the body to fight the germs that cause the infections. Vaccines usually come in shots, but some come in nose sprays or medicines that people swallow. Vaccines are also called &ldquo;vaccinations&rdquo; or &ldquo;immunizations.&rdquo;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1643010852\">",
"      <span class=\"h1\">",
"       Why should I get vaccinated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Getting vaccinated can help keep you from getting certain serious infections. It&rsquo;s important to be vaccinated even if you don&rsquo;t become pregnant. But if you are pregnant and get certain infections, you can have problems during your pregnancy. Being vaccinated can also help keep your baby from getting sick.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1643010859\">",
"      <span class=\"h1\">",
"       What should I know about vaccines if I am planning to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you are planning to get pregnant, you should make sure that your vaccines are up to date. This means that you have gotten all of the vaccines that your doctor or nurse recommends. If you are not sure if you got all of your vaccines, your doctor or nurse might do a blood test to check.",
"     </p>",
"     <p>",
"      It&rsquo;s especially important that women be up to date with their vaccines for measles, mumps, rubella, and chickenpox before they get pregnant. That&rsquo;s because vaccines to prevent these infections cannot be given to pregnant women. If women who have not been vaccinated do get these infections during pregnancy, they can have problems. Problems can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Having a baby with a birth defect",
"       </li>",
"       <li>",
"        Giving birth too early",
"       </li>",
"       <li>",
"        Having a miscarriage &ndash; A miscarriage is when a pregnancy ends on its own.",
"       </li>",
"       <li>",
"        Spreading the infection to the baby",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Women who need the measles, mumps, rubella, or chickenpox vaccines should get them at least 1 month before getting pregnant.",
"     </p>",
"     <p>",
"      It&rsquo;s also important that women be up to date with a vaccine called the HPV vaccine before they get pregnant. The HPV vaccine is another vaccine that cannot be given to pregnant women.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1643010866\">",
"      <span class=\"h1\">",
"       Do I need the chickenpox vaccine if I had chickenpox infection?",
"      </span>",
"      &nbsp;&mdash;&nbsp;No. If you had chickenpox infection in the past, you do not need to get the vaccine. People who have had chickenpox can&rsquo;t get the illness again.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1643010873\">",
"      <span class=\"h1\">",
"       Which vaccines are safe to get during pregnancy?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Some vaccines are safe to get during pregnancy. These include vaccines to prevent:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Influenza (flu) &ndash; All adults should get the flu vaccine each year. But it&rsquo;s especially important for pregnant women to get the flu vaccine. That&rsquo;s because pregnant women tend get more severely ill with the flu than people who are not pregnant. The flu vaccine can keep a woman from getting sick. It can also keep a baby from getting the flu during the first few months of life.",
"       </li>",
"       <li>",
"        Tetanus, diphtheria, and pertussis &ndash; Tetanus causes the muscles to work abnormally. Diphtheria can cause a thick covering in the back of the throat that can lead to breathing problems. Pertussis, also known as &ldquo;whooping cough,&rdquo; causes a severe cough. All pregnant women should get the tetanus, diphtheria, and pertussis vaccine at 27 to 36 weeks of pregnancy, even if they got it before.",
"       </li>",
"       <li>",
"        Some women might get other vaccines while they are pregnant. For example, women might need certain vaccines if they have other medical conditions or plan to travel to another country.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1643010880\">",
"      <span class=\"h1\">",
"       How many vaccine doses do I need?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Each vaccine is different. Some vaccines work after just 1 dose. Others need 2 or more doses to prevent an infection. Most vaccines take a few weeks to work.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1643010887\">",
"      <span class=\"h1\">",
"       What side effects can vaccines cause?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Often, vaccines cause no side effects. When they do cause side effects, they can cause:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Redness, mild swelling, or soreness where the shot was given",
"       </li>",
"       <li>",
"        A mild fever",
"       </li>",
"       <li>",
"        A mild rash",
"       </li>",
"       <li>",
"        Headache or body aches",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Vaccines also sometimes cause more serious side effects, such as severe allergic reactions. But serious side effects are rare.",
"     </p>",
"     <p>",
"      Ask your doctor or nurse what side effects to expect each time you get a vaccine. If you have a reaction or a problem after a vaccine, let him or her know.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1643010894\">",
"      <span class=\"h1\">",
"       What if I have an egg allergy?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you have an egg allergy, let your doctor or nurse know. Some vaccines have egg in them because of how they are made. Your doctor or nurse will tell you which vaccines are safe to get.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1643010901\">",
"      <span class=\"h1\">",
"       What if I am pregnant and never got the measles, mumps, rubella, or chickenpox vaccines?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you are pregnant and never got these vaccines and never had these infections, you should avoid people with these infections.",
"     </p>",
"     <p>",
"      If you find out that someone around you has chickenpox, call your doctor or nurse as soon as possible. He or she can give you a medicine to reduce your chances of getting it.",
