"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?7/52/8010/contributors\">",
"     Sheldon L Kaplan, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?7/52/8010/contributors\">",
