var title_f7_52_8013="Tetanus prophylaxis";
var content_f7_52_8013=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F61087&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F61087&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Wound management and tetanus prophylaxis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"5\" width=\"20%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Previous doses of tetanus toxoid*",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"2\">",
"        Clean and minor wound",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"2\">",
"        All other wounds",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Tetanus toxoid-containing vaccine",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td class=\"subtitle2\">",
"        Human tetanus immune globulin",
"       </td>",
"       <td class=\"subtitle2\">",
"        Tetanus toxoid-containing vaccine",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td class=\"subtitle2\">",
"        Human tetanus immune globulin",
"        <sup>",
"         &sect;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &lt;3 doses or unknown",
"       </td>",
"       <td>",
"        Yes",
"        <sup>",
"         &yen;",
"        </sup>",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        Yes",
"        <sup>",
"         &yen;",
"        </sup>",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &ge;3 doses",
"       </td>",
"       <td>",
"        Only if last dose given &ge;10 years ago",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        Only if last dose given &ge;5 years ago",
"        <sup>",
"         ������",
"        </sup>",
"       </td>",
"       <td>",
"        No",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Appropriate tetanus prophylaxis should be administered as soon as possible following a wound, but should be given even to patients who present late for medical attention. This is because the incubation period is quite variable; most cases occur within&nbsp;eight days, but the incubation period can be as short as one day or as long as several months.",
"    <div class=\"footnotes\">",
"     * Tetanus toxoid may have been administered as diphtheria-tetanus toxoids adsorbed (DT), diphtheria-tetanus-whole cell pertussis (DTP, DTwP; no longer available in the United States), diphtheria-tetanus-acellular pertussis (DTaP), tetanus-diphtheria toxoids adsorbed (Td), booster tetanus toxoid-reduced diphtheria toxoid-acellular pertussis (Tdap), or tetanus toxoid (TT).",
"     <br>",
"      &Delta; Such as, but not limited to, wounds contaminated with dirt, feces, soil, or saliva; puncture wounds; avulsions; wounds resulting from missiles, crushing, burns, or frostbite.",
"      <br>",
"       <font class=\"lozenge\">",
"        &loz;",
"       </font>",
"       The preferred vaccine preparation depends upon the age and vaccination history of the patient:",
"       <br>",
"        <ul>",
"         <li>",
"          &lt;7 years: DTaP.",
"         </li>",
"         <li>",
"          Underimmunized children &ge;7 and &lt;11 years who have not received Tdap previously: Tdap. Children who receive Tdap between age 7 and 11 years do not require revaccination at age 11 years.",
"         </li>",
"         <li>",
"          &ge;11 years: A single dose of Tdap is preferred to Td for all individuals in this age group who have not previously received Tdap.",
"         </li>",
"         <li>",
"          Td is preferred to TT for those who received Tdap previously and when Tdap is not available.",
"         </li>",
"        </ul>",
"        &sect; 250 units intramuscularly at a different site than tetanus toxoid; intravenous immune globulin should be administered if human tetanus immune globulin is not available.",
"        <br>",
"         &yen; The vaccine series should be continued through completion as necessary.",
"         <br>",
"          &Dagger; Booster doses given more frequently than every five years are not needed and can increase adverse effects.",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Data from:",
"     <br>",
"      <ol>",
"       <li>",
"        Advisory Committee on Immunization Practices. Recommended adult immunization schedule: United States, 2012. Ann Intern Med 2012; 156:211.",
"       </li>",
"       <li>",
"        Centers for Disease Control and Prevention (CDC). Updated recommendations for use of tetanus toxoid, reduced diphtheria toxoid and acellular pertussis (Tdap) vaccine from the Advisory Committee on Immunization Practices, 2010. MMWR Morb Mortal Wkly Rep 2011; 60:13.",
"       </li>",
"       <li>",
"        Centers for Disease Control and Prevention. Updated recommendations for use of tetanus toxoid, reduced diphtheria toxoid, and acellular pertussis (Tdap) vaccine in adults aged 65 years and older &mdash; Advisory Committee on Immunization Practices (ACIP), 2012. MMWR Morb Mortal Wkly Rep 2012; 61:468.",
"       </li>",
"      </ol>",
"      <p>",
"       From: American Academy of Pediatrics. Pertussis. In: Red Book: 2012 Report of the Committee on Infectious Diseases, 29th ed, Pickering LK (Ed), American Academy of Pediatrics, Elk Grove Village, IL 2012. Used with permission of the American Academy of Pediatrics. Copyright &copy; 2012.",
"      </p>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
