var title_f7_52_8014="rHuTPO intensive chemotherapy";
var content_f7_52_8014=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F77335&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F77335&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 498px\">",
"   <div class=\"ttl\">",
"    Use of recombinant human thrombopoietin after intensive chemotherapy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 478px; height: 277px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Patients with gynecologic malignancy were treated with high dose carboplatin on day 1 alone (red columns) or with carboplatin followed by the daily adminisration of rHuTPO (blue columns). The administration of rHuTPO significantly increased the nadir platelet count, decreased the duration of thrombocytopenia, and reduced the need for platelet transfusion.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Vadhan-Raj, S, Verschraegen, C, McGarry, L, et al, Blood 1997; 90(Suppl 1):580a.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
